#include <bits/stdc++.h>
using namespace std;

vector<pair<int,int>> moves = {
	{0,-1}, {0,+1}, {-1,0}, {+1,0}
};
class Solution {
	int M, N;
public:
    void solve(vector<vector<char>>& board) {
      	M = board.size();
		N = board[0].size();
		set<pair<int,int>> visited;
		for (int y = 0; y < M; y++){
			for (int x = 0; x < N; x++){
				// cout << "cell: " << cell << endl;
				if (inBounds(x, y)){
					visited.clear();
					if (board[y][x] == 'O' && !dfs(x, y, visited, board)){
						cout << "Going in (" << x << "," << y << ")\n";
						for (pair<int,int> move : moves){
							int nx = move.first + x, ny = move.second + y;
							if (!inBounds(nx, ny) && board[ny][nx] == 'O')
								visited.clear();
						}
						for (auto [dx, dy] : visited)
							board[dy][dx] = 'X';
					}
				}
			}
		}
    }
private:

	bool inBounds(int x, int y){
		return (x >= 1 && y >= 1 && x < N-1 && y < M-1);
	}

	bool dfs(int x, int y, set<pair<int,int>>& visited, vector<vector<char>> board){ // ret true if touches border
		visited.insert(make_pair(x,y));
		if (!inBounds(x,y))
			return true;
		// cout << x << "," << y << "\n";
		bool flags = false;
		for (pair<int,int> move : moves){
			int nx = move.first + x; 
			int ny = move.second + y;
			if (board[ny][nx] == 'O' &&
				visited.find(make_pair(nx,ny)) == visited.end())
					flags += dfs(nx, ny, visited, board);
		}
		return flags;
	}
};

template<typename T>
void printMat(vector<vector<T>> mat){
	for (vector<T> row : mat){
		for (T cell : row)
			cout << cell << " ";
		cout << "\n";
	}
	cout << "\n";
}

